import React, {Componen} from 'react';


class ShopSideBarCate extends Component {
    render(){
        return(
            <ListItem button >
                <ListItemIcon>
                    {this.props.cateicon}
                </ListItemIcon>
                <ListItemText primary={this.props.catename} />
            </ListItem>
        )
    }
}

export default ShopSideBarCate;
